package model;

public class ClanKomisije {
	String uloga;
	Integer radnikID;
	Integer komisijaID;
	
	
	public ClanKomisije() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getUloga() {
		return uloga;
	}
	public void setUloga(String uloga) {
		this.uloga = uloga;
	}
	public Integer getRadnikID() {
		return radnikID;
	}
	public void setRadnikID(Integer radnikID) {
		this.radnikID = radnikID;
	}
	public Integer getKomisijaID() {
		return komisijaID;
	}
	public void setKomisijaID(Integer komisijaID) {
		this.komisijaID = komisijaID;
	}
	
	

}
